import React from 'react';

export default function Portfolio(props) {

    const projectStyle = {height:200, width:'70%', backgroundColor:'gray', borderRadius:15, justifyContent:'center'}
    const buttonStyle = {color:'black'}
    return(
      <>
       {props.projects.map((project) => {
           return(
               <div style={projectStyle}>
                   <h1 style={{textAlign:'center'}}>{project.title}</h1>
                   <img style={{width:400}}alt={project.title} src={project.img} />
                   <button style={buttonStyle}><a href={project.ghlink}>GitHub Repo</a></button>
                   <button><a href={project.deployed}>Deployed Site</a></button>
               </div>
           )
       })}
      </>
    )
}

